HM接口说明
HM对外提供数据访问api，具体形式如下：
http://ip:port/hm/cache/q 
该接口允许用户对缓存的profile(画像)，monitor(实时监控)，iplink(服务流)数据进行查询，默认暴露的查询端口为8765，下面对具体数据类型的查询方式举例加以说明。
1，profile数据

查询所有的画像数据
POST localhost:8765/hm/cache/q
{
    "intent":"profile",
    "request":{    
     }
}
结果返回
返回结果形式如下：
{rs: "{"UAV@http://127.0.0.1:8080/apphub/…{}}}\..."}"}

rs中的具体内容形式如下,其中key值为具体实例的唯一标识，由{appgroup}@{appurl}构成，value值为相应实例的profile数据
